import React, { useState } from "react";
import { Container, Table, Button, Modal, ModalHeader, ModalBody } from "reactstrap";
import { withAuthenticationRequired } from "@auth0/auth0-react";
import "./admin.css"; // Import the admin.css file

const Dashboard = () => {
    const [reportData, setReportData] = useState([
        // ... (your report data)
    ]);

    const [popupReport, setPopupReport] = useState(null);

    const handleAuthorize = (id) => {
        const updatedReportData = reportData.map((report) =>
            report.id === id ? { ...report, status: "Authorized" } : report
        );
        setReportData(updatedReportData);
    };

    const handleDeny = (id) => {
        const updatedReportData = reportData.map((report) =>
            report.id === id ? { ...report, status: "Denied" } : report
        );
        setReportData(updatedReportData);
    };

    const handleOpenReport = (report) => {
        setPopupReport(report);
    };

    const handleCloseReport = () => {
        setPopupReport(null);
    };

    return (
        <Container>
            <Table className="mt-4">
                <thead>
                <tr>
                    <th>Report ID</th>
                    <th>Date</th>
                    <th>Report Name</th>
                    <th>Report Description</th>
                    <th>Status</th>
                    <th>Reporter</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {reportData.map((report) => (
                    <tr
                        key={report.id}
                        onClick={() => handleOpenReport(report)}
                        style={{ cursor: "pointer" }}
                        className="hover-grey"
                    >
                        <td>{report.id}</td>
                        <td>{report.date}</td>
                        <td>{report.reportName}</td>
                        <td>{report.reportDescription}</td>
                        <td>{report.status}</td>
                        <td>{report.reporter}</td>
                        <td>
                            {report.status === "Pending" && (
                                <>
                                    <Button color="success" onClick={() => handleAuthorize(report.id)} className="mr-2">
                                        Authorize
                                    </Button>
                                    <Button color="danger" onClick={() => handleDeny(report.id)}>
                                        Deny
                                    </Button>
                                </>
                            )}
                        </td>
                    </tr>
                ))}
                </tbody>
            </Table>
            <Modal isOpen={popupReport !== null} toggle={handleCloseReport}>
                <ModalHeader toggle={handleCloseReport}>
                    Report Details
                </ModalHeader>
                <ModalBody>
                    {popupReport && (
                        <div>
                            <div>
                                <strong>Report ID:</strong> {popupReport.id}
                            </div>
                            <div>
                                <strong>Date:</strong> {popupReport.date}
                            </div>
                            <div>
                                <strong>Report Name:</strong> {popupReport.reportName}
                            </div>
                            <div>
                                <strong>Report Description:</strong> {popupReport.reportDescription}
                            </div>
                            <div>
                                <strong>Status:</strong> {popupReport.status}
                            </div>
                            <div>
                                <strong>Reporter:</strong> {popupReport.reporter}
                            </div>
                            {/* You can add more details here */}
                            <div>
                                <img src={popupReport.imageUrl} alt="Report" className="img-fluid" />
                            </div>
                            <Button color="secondary" onClick={handleCloseReport} className="mt-3">
                                Close
                            </Button>
                        </div>
                    )}
                </ModalBody>
            </Modal>
        </Container>
    );
};

export default withAuthenticationRequired(Dashboard, {});
